public class InnerExportExportFactory(Action<Humidifier.BCMDataExports.ExportTypes.Export> factoryAction = null) : SubResourceFactory<Humidifier.BCMDataExports.ExportTypes.Export>
{

    internal InnerExportRefreshCadenceFactory RefreshCadenceFactory { get; set; }

    internal InnerExportDataQueryFactory DataQueryFactory { get; set; }

    internal InnerExportDestinationConfigurationsFactory DestinationConfigurationsFactory { get; set; }

    protected override Humidifier.BCMDataExports.ExportTypes.Export Create()
    {
        var exportResult = CreateExport();
        factoryAction?.Invoke(exportResult);

        return exportResult;
    }

    private Humidifier.BCMDataExports.ExportTypes.Export CreateExport()
    {
        var exportResult = new Humidifier.BCMDataExports.ExportTypes.Export();

        return exportResult;
    }
    public override void CreateChildren(Humidifier.BCMDataExports.ExportTypes.Export result)
    {
        base.CreateChildren(result);

        result.RefreshCadence ??= RefreshCadenceFactory?.Build();
        result.DataQuery ??= DataQueryFactory?.Build();
        result.DestinationConfigurations ??= DestinationConfigurationsFactory?.Build();
    }

} // End Of Class

